package ravi.ravieggcatcher;import javax.swing.JFrame;public class RaviEggCatcher extends JFrame {		public RaviEggCatcher() {				this.setLayout(null);		this.setTitle("Ravi Egg Catcher");		this.setDefaultCloseOperation(JFrame.EXIT_ON_CLOSE);				new RaviEggCatcherStartGameHandler(this);				this.pack();		this.setSize(515, 530);		this.setVisible(true);			}		public static void main(String[] args) {				new RaviEggCatcher();			}	}